import React from 'react';
import { Typography }from '@material-ui/core';
import './Progress.css';

const Progress = ({attempt ,guessList}) => {
    return (
        <div>
            <h4 className="progressBar">Guess #{attempt} </h4>
            <ul className="progressBar_history">
                {guessList}
            </ul>
        </div>
    )
}

export default Progress;
